import React from "react";
im

function SportCarCollection( {sportCar} ) {

    const displaySportCar = sportCar.map((sport) => {
        return (
            < SportCarCard 
              sport= {sport}
              key= {sport.id}
            />
        )
    })

    return (
        <div>
            {displaySportCar}
        </div>
    )
}

export default SportCarCollection;
